import '../App.css';
import React from 'react';



function Blog() {

return(
	<div className="App-total">
		<header className="App-total">

	<h1>Pobbleblog</h1>
		</header>


		<body className="App-body">
			<h3><b> 1/1/22</b> - Happy New Year from Michigan!  I'm still trying to figure out what I'll end up putting here.  I think I'm drawn to Shawn Wang's concept of "Learning in Public."  Mostly because I've learned so much from other developers who have done the same.  In fact I'm still to this day shocked at how easy it is to find tutorials/blog posts/and real live help from people for free online.  I feel a bit indebted to the software dev community in that sense and would love to help anyone out who could somewhat benefit from me.</h3>
			<h3>To start off I want to say flat out that I know everything that you see here looks like a work in progress.  I don't know if that's a bad or a good thing.  I mean, I loved how amateurish craigslist used to be.  I know even this blog needs to be styled better.  But this is what I hope is a multi-year project that I just chip away at in my freetime and things should look like a more put together package as I get more time.</h3><h3> The app is fully functional as noted before and I was going to start giving it awaytoday to a select few comedians but in waiting for the ball to drop last night I downloaded the latest version on my phone and and I want to work that out.  I plan on heading back to Miami towards the end of the month and will be more active in distributing the beta release by then.  I'll also be networking quite a bit in the #MiamiTech scene because I'm going to have to pivot my attention a little bit away from programming to the actual rolling out of the project and all the issues involved with that.  I don't come from the tech world so I feel like I'm in my freshman year of college on this stuff.  So far I've just been watching Silicon Valley on HBO Max.  </h3>
			<h3>Working on:  <li>App: page doesn't refresh after transitioning to a separate page</li><li>Webpage: Making a new hamburger menu for website that uses React and grid</li><li>Webpage: create a real blog page that draws from a database</li></h3>
			<h3><b>12/26/21</b> - The app is fully functional.  For the website I'm still working on building the table migration.</h3>

		</body>
	</div>
);
}


export default Blog;
